import React from "react";
import './completedTask.scss';
import {TaskCompleteTime} from "./TaskCompleteTime";
import {CompletedTaskAlert} from "../AlertComponent/AlertComponent";

export const CompletedTask = ({task,completeTaskThunk}) => {
    console.log('DONETASK_RENDER')
    return(
        <div>
            <div className= {task.completedTask ? `task-item_text text` : `task-item_text text-width` }>
                <CompletedTaskAlert task={task} completeTaskThunk={completeTaskThunk}/>
                <div>{task.task} {task.edited ? <span>(edited)</span> : null}</div>
            </div>

            <div>
                <TaskCompleteTime task={task}/>
            </div>
        </div>
    )
}
